function FilterSvg(props: React.SVGProps<SVGSVGElement>) {
  return (
<svg
        xmlns="http://www.w3.org/2000/svg"
        className="h-5 w-5"
        viewBox="0 0 24 24"
        fill="none"
        stroke="currentColor"
        strokeWidth="2"
        strokeLinecap="round"
        strokeLinejoin="round"
      >
        <path
          d="M4 6h16M4 12h8m-8 6h8"
        />
      </svg>
  );
}
//okay
export default FilterSvg;
